SET FOREIGN_KEY_CHECKS = 0;

DROP TABLE IF EXISTS  `members`;
CREATE TABLE `members` (
  `member_id` bigint(255) NOT NULL DEFAULT '0' COMMENT '会员ID',
  `gender` varchar(255) DEFAULT NULL COMMENT '会员性别',
  `age` int(255) DEFAULT NULL COMMENT '会员年龄',
  `city` varchar(255) DEFAULT NULL COMMENT '注册城市',
  `name` varchar(255) DEFAULT NULL COMMENT '会员名字',
  `phone` bigint(255) DEFAULT NULL COMMENT '手机号码',
  `registration_date` date DEFAULT NULL COMMENT '注册日期',
  PRIMARY KEY (`member_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS  `product`;
CREATE TABLE `product` (
  `Product_ID` varchar(255) NOT NULL DEFAULT '0' COMMENT '产品ID',
  `Base_Category` varchar(255) DEFAULT NULL COMMENT '产品大类',
  `Category` varchar(255) DEFAULT NULL COMMENT '产品小类',
  `Price` float(255,0) DEFAULT NULL COMMENT '产品单价',
  PRIMARY KEY (`Product_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS  `push`;
CREATE TABLE `push` (
  `camp_id` bigint(255) NOT NULL DEFAULT '0' COMMENT '推送活动ID',
  `camp_name` varchar(255) DEFAULT NULL COMMENT '推送活动名称',
  `drop_dt` date DEFAULT NULL COMMENT '推送日期',
  `Cost` float(255,0) DEFAULT NULL COMMENT '推送成本',
  PRIMARY KEY (`camp_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS  `push detail`;
CREATE TABLE `push detail` (
  `promo_id` bigint(255) DEFAULT NULL COMMENT '推送ID',
  `member_id` bigint(255) DEFAULT NULL COMMENT '会员ID',
  `camp_id` bigint(255) DEFAULT NULL COMMENT '推送活动ID',
  `read_date` date DEFAULT NULL COMMENT '阅读日期',
  `read_flag` varchar(255) DEFAULT NULL COMMENT '是否阅读',
  `like_date` date DEFAULT NULL COMMENT '点赞日期',
  `like_flag` varchar(255) DEFAULT NULL COMMENT '是否点赞'
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS  `sales`;
CREATE TABLE `sales` (
  `transaction_id` bigint(255) NOT NULL DEFAULT '0' COMMENT '交易记录ID',
  `member_id` bigint(255) DEFAULT NULL COMMENT '会员ID',
  `product_id` varchar(255) DEFAULT NULL COMMENT '产品ID',
  `shop_name` varchar(255) DEFAULT NULL COMMENT '门店名称',
  `amount` float(255,0) DEFAULT NULL COMMENT '交易金额',
  `transaction_date` date DEFAULT NULL COMMENT '交易时间',
  `quant` int(255) DEFAULT NULL COMMENT '交易量',
  `city` varchar(255) DEFAULT NULL COMMENT '交易城市',
  `delivery_city` varchar(255) DEFAULT NULL COMMENT '目标运达城市',
  PRIMARY KEY (`transaction_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

SET FOREIGN_KEY_CHECKS = 1;

